//Functions
function symbolToNumber(numb) {
if (numb == '①' || numb == '❶') { numb = 1;
} else if (numb == '②' || numb == '❷') { numb = 2;
} else if (numb == '③' || numb == '❸') { numb = 3;
} else if (numb == '④' || numb == '❹') { numb = 4;
} else if (numb == '⑤' || numb == '❺') { numb = 5;
} else if (numb == '⑥' || numb == '❻') { numb = 6;
} else if (numb == '⑦' || numb == '❼') { numb = 7;
} else if (numb == '⑧' || numb == '❽') { numb = 8;
} else if (numb == '⑨' || numb == '❾') { numb = 9;
} else if (numb == '⑩' || numb == '❿') { numb = 10;
} else if (numb == '⑪' || numb == '⓫') { numb = 11;
} else if (numb == '⑫' || numb == '⓬') { numb = 12;
} else if (numb == '⑬' || numb == '⓭') { numb = 13;
} else if (numb == '⑭' || numb == '⓮') { numb = 14;
} else if (numb == '⑮' || numb == '⓯') { numb = 15;
} else if (numb == '⓪' || numb == '⓿') { numb = 0;
} else { numb = -1; }
return numb;
}

