var atk = clip2.slice(posatk,posatk+1);
var def = clip2.slice(posatk+1,posatk+2);
var sta = clip2.slice(posatk+2,posatk+3);
 
atk = symbolToNumber(atk);
def = symbolToNumber(def);
sta = symbolToNumber(sta);
 
//Lookup pokemon number and find our species number 
for(var i=0; i<basestats.length; i++) {
    if(basestats[i]['Number'] == pokenum && basestats[i]['Form'] == 1) {
      var species = basestats[i]['Species'];
    }
}
 
var baseatk = [];
var basedef = [];
var basesta = [];
var maxstats = [];
var pokename = [];

//Search for all species in the data
for(var i=0; i<basestats.length; i++) {
    if(basestats[i]['Species'] == species) {
      baseatk.push(basestats[i]['Attack']);
      basedef.push(basestats[i]['Defense']);
      basesta.push(basestats[i]['HP']);
      maxstats.push(basestats[i]['Product']);
      pokename.push(basestats[i]['Pokemon']);
    }
}
 

var output = '';
//For each bit of data in our array do this
for(var i=0; i<baseatk.length; i++) {
	var totalatk = baseatk[i] + atk;
	var totaldef = basedef[i] + def;
	var totalsta = basesta[i] + sta;
	var levelatk = 0;
	var leveldef = 0;
	var levelsta = 0;
	var cpm = cpmvallist[0];
	var cp = 0;
	var maxcp = 10;
	var maxlevel = 0;
	var maxatk = 0;
	var maxdef = 0;
	var maxsta = 0;
	 
	for(var level=0; level < 79; level=level+1) {
	  cpm = cpmvallist[level];
	  levelatk = totalatk * cpm;
	  leveldef = totaldef * cpm;
	  levelsta = Math.floor(totalsta * cpm);
	  cp = Math.floor((totalatk * Math.sqrt(totaldef) * Math.sqrt(totalsta) * cpm * cpm) / 10);
	  if (cp < 1501) {
	    maxlevel = level;
	    maxcp = cp;
	    maxatk = levelatk;
	    maxdef = leveldef;
	    maxsta = levelsta;
	  }
	 
	}

	//Calculate Rank
	var ranks = [];
	//Calculate all results, sort then find position
	for(var a=0; a < 16; a++) {
		for(var b=0; b < 16; b++) {
			for(var c=0; c < 16; c++) {
				for(var level=0; level < 79; level=level+1) {
				  cpm = cpmvallist[level];
				  cp = Math.floor(((a + baseatk[i]) * Math.sqrt(b + basedef[i]) * Math.sqrt(c + basesta[i]) * cpm * cpm) / 10);
				  if (cp < 1501) {
				  	levelatk = (a + baseatk[i]) * cpm;
				  	leveldef = (b + basedef[i]) * cpm;
				  	levelsta = Math.floor((c + basesta[i]) * cpm);
				    var product = (levelatk * leveldef * levelsta);
				  }	 else {
				    level = 80;
				  }
				}
				ranks.push(product);
			}
		}
	}
	ranks = ranks.sort(function(a, b){return a - b})
//	console.log(ranks.length);
	maxproduct = maxatk*maxdef*maxsta;
	var finalrank = 1;
	for(var j=0; j < ranks.length; j++) {
		if(maxproduct < ranks[j]) {
			finalrank = (4096 - j + 1);
			j = 5000;
		}
	}


	var perc = (maxatk*maxdef*maxsta)/maxstats[i]*100;
	perc = pokename[i] + ': ' + perc.toFixed(2) + '% ' + finalrank + String.fromCharCode(10);
	output = output + perc;
}
